package com.roc.cloud.log.model;import com.alibaba.fastjson.annotation.JSONField;import lombok.Getter;import lombok.Setter;import java.time.LocalDateTime;/** * 审计日志 * * @author: Roc * @date 2020/2/3 * <p> */@Setter@Getterpublic class Audit {    /**     * 索引名称 对应枚举类EsIndexNameEnum name     */    @JSONField(name = "index_name")    private String indexName;    /**     * 审核ID     */    @JSONField(name = "audit_id")    private String auditId;    /**     * 应用名称     */    @JSONField(name = "application_name")    private String applicationName;    /**     * 业务系统名称     */    @JSONField(name = "business_type")    private String businessType;    /**     * 类名称     */    @JSONField(name = "class_name")    private String className;    /**     * 方法名称     */    @JSONField(name = "method_name")    private String methodName;    /**     * 机构id     */    @JSONField(name = "company_id")    private String companyId;    /**     * 日志渠道类型     */    @JSONField(name = "channel_type")    private String channelType;    /**     * 用户id     */    @JSONField(name = "user_id")    private String userId;    /**     * 用户名称     */    @JSONField(name = "user_name")    private String userName;    /**     * 工号     */    @JSONField(name = "work_id")    private String workId;    /**     * 操作名称     */    @JSONField(name = "process_name")    private String processName;    /**     * ip     */    @JSONField(name = "ip")    private String ip;    /**     * 操作时间     */    @JSONField(name = "timestamp")    private LocalDateTime timestamp;    /**     * 操作信息     */    @JSONField(name = "operation")    private String operation;}